            .request("SELECT * FROM Table1 WHERE Table1.|");

        Assert.assertEquals(3, proposals.size());
        Assert.assertEquals("Col1", proposals.get(0).getReplacementString());
        Assert.assertEquals("Col2", proposals.get(1).getReplacementString());
